B.Bb=A.a(s(["Finansial","Pemerintah menetapkan bulan Oktober sebagai Bulan Inklusi Keuangan  dan bersama berbagai institusi keuangan lintas industri,  mengadakan beragam  kegiatan untuk meningkatkan inklusi keuangan  di masyarakat. Pada Bulan Inklusi Keuangan 2022, salah satu kegiatan yang digelar BRI Finance adalah  literasi keuangan melalui kuliah umum di Fakultas Pertanian Universitas Padjadjaran (Unpad) Jatinangor, Jawa Barat."]),t.s)
B.AK=A.a(s(["Finansial","Financial Freedom atau merdeka finansial diartikan sebagai sebuah kondisi di mana seseorang terbebas dari segala jenis utang, memiliki penghasilan pasif yang bisa mencukupi kebutuhan hidup, terlindungi secara finansial dari seluruh risiko, dan tidak lagi pusing ketika harus mengeluarkan uang untuk bersenang-senang."]),t.s)
B.B9=A.a(s(["Finansial","Kecerdasan finansial adalah kemampuan seseorang dalam memahami pentingnya perencanaan dan penerapan tata kelola keuangan yang baik yang pada akhirnya membawa dia mampu mewujudkan impian dan harapannya. Tolok ukurnya bisa bermacam-macam, mulai dari tingkat penghasilan, kemampuan seseorang dalam menyisihkan penghasilannya untuk diinvestasikan, sampai dengan kemampuan seseorang dalam memilih investasi yang tepat yang memberikan passive income yang besar baginya."]),t.s)
B.Bm=A.a(s(["Politik","Menjelang puncak KTT G20, Direktorat Jenderal Imigrasi Kementerian Hukum dan HAM (Kemenkumham) RI, resmi meluncurkan kebijakan visa rumah kedua atau second home visa, pada Selasa (25/10). Kebijakan tersebut tercantum dalam Surat Edaran (SE) Nomor IMI-0740.GR.01.01, tahun 2022 tentang pemberian visa dan izin tinggal terbatas rumah kedua yang diterbitkan pada 25 Oktober 2022."]),t.s)
B.Ba=A.a(s(["Sejarah","Selama sepekan, tanggal 17 sampai 24 Juni 1916, di alun-alun Bandung seperti ada pasar malam. Bukan pasar malam sebenarnya yang sedang berlangsung, melainkan Kongres Sarikat Islam. Panitia Kongres bertekad membuat waktu itu juga menjadi pekan untuk berpesta. Seluruh alun-alun dipajang, tarup pesta yang besar dibangun, dimana dibuka buffet untuk jualan makanan dan minuman yang dapat mengelus-ngelus lidah. Gubuk-gubuk dibangun berderet dalam garis yang rapih, dimana dipamerkan dan dijual macam-macam barang kerajinan rakyat. Hasil bersih dari usaha itu akan didarmakan kepada Sekolah Agama Islam yang belum berselang lama didirikan."]),t.s)
B.A0=A.a(s(["Fiksi","Jacques Pangemanann yang merupakan seorang komisaris polisi Hindia Belanda berdarah Minahasa dalam memberantas kelompok Si Pitung membuatnya ditugaskan untuk memata-matai aktivitas Minke. Tugas inilah yang membuat Jacques Pangemanann menjadi sosok yang bertanggung jawab dibalik pembuangan Minke ke pulau terpencil di Maluku Utara.[2]"]),t.s)
